import { HashRouter, Redirect, Route, Switch } from "react-router-dom";
import { GlobalStyle } from "./GlobalStyle";

import { Main } from "../common/Main";
import { Footer } from "../common/Footer";


function App() {
  return (
    <>
      <GlobalStyle />
      <HashRouter>
        <Top/>
        <Main>
          <Switch>
            <Route path="/">
              <Redirect to="/o-nas" /></Route>
          </Switch>
        </Main> 
        <Footer />
      </HashRouter >
    </>
  );
}

export default App;
